import React from "react";
import "./App.css";
import Video from "./Video";
import Video__Kadeemh from "./vids/TikTok__1.mp4";
import Video__Leenh from "./vids/TikTok__2.mp4";

function App() {
  return (
    <div className="app">
      <center>
        <div className="app__videos">
          <Video
            url={Video__Kadeemh}
            channel="Kadeemh"
            description="Basement chronicles 4: shawarma medium spice please"
            song=" بام بام - محمد رمضان"
            likes={2019}
            messages={196}
            shares={114}
          />

          <Video
            url={Video__Leenh}
            channel="Leenhabbal"
            description=" مين متلي ما بيشعر بالوقت عالtiktok? #tiktokarab #arab #middleeastern"
            song="Come and Get Your Love"
            likes={123}
            messages={12121}
            shares={12121}
          />
          <Video
            url="http://download1083.mediafire.com/zq6sbop82x5g/5bd5aw8s1ez6cz9/Jason+Derulo+%28%40jasonderulo%29+on+TikTok+-+Nobody+gets+between+me+and+my+%40littlecaesarspizza+Stuffed+Crazy+Bread+%23GoCrazy+%23littlecaesars+%23ad+%23whoisUzo.mp4"
            channel="Jasonderulo"
            description=" Nobody gets between me and my @littlecaesarspizza Stuffed Crazy Bread"
            song="Go Crazy - Little Caesars"
            likes={97223}
            messages={8811}
            shares={3298}
          />
        </div>
      </center>
    </div>
  );
}

export default App;
